import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import logo from '../../assets/images/IMG_20240317_201244.jpg'
import Button from 'react-bootstrap/Button';

const Header = () => {
  return (
    <>
    <Navbar bg="light" data-bs-theme="white">
        <Container>
          <Navbar.Brand href="#home">
            <img src={logo} alt="" width={"50%"}  height={""} />
          </Navbar.Brand>
          <Nav className="ms-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">About</Nav.Link>
            <Nav.Link href="#pricing">Tours</Nav.Link>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
           <Link> <Button variant='warning' >Login</Button></Link> &nbsp;
           <Link> <Button variant='outline-warning'>Register</Button></Link>
          </Nav>
        </Container>
      </Navbar>
    </>
  )
}

export default Header
